import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      minHeight: "100vh",
      margin: 0,
      fontFamily: "'Roboto', sans-serif",
      background: "linear-gradient(to bottom, #e3f2fd, #bbdefb)",
    },
    sidebar: {
      width: "250px",
      backgroundColor: "#0d47a1",
      color: "#ffffff",
      padding: "20px",
      boxShadow: "2px 0 5px rgba(0, 0, 0, 0.1)",
    },
    sidebarTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      textAlign: "center",
      marginBottom: "30px",
      textTransform: "uppercase",
      letterSpacing: "2px",
    },
    sidebarMenu: {
      listStyleType: "none",
      padding: 0,
    },
    sidebarLink: {
      color: "#ffffff",
      textDecoration: "none",
      display: "block",
      padding: "12px 18px",
      borderRadius: "8px",
      marginBottom: "10px",
      fontWeight: "500",
      fontSize: "16px",
      transition: "background-color 0.3s ease",
    },
    sidebarLinkHover: {
      backgroundColor: "#1565c0",
    },
    mainContent: {
      flexGrow: 1,
      padding: "20px",
    },
    header: {
      backgroundColor: "#1e88e5",
      color: "#ffffff",
      padding: "20px",
      borderRadius: "8px",
      marginBottom: "30px",
      textAlign: "center",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    },
    headerTitle: {
      fontSize: "28px",
      fontWeight: "bold",
    },
    cardsContainer: {
      display: "flex",
      gap: "20px",
      flexWrap: "wrap",
      justifyContent: "center",
    },
    card: {
      backgroundColor: "#2196f3",
      color: "#ffffff",
      padding: "20px",
      borderRadius: "12px",
      width: "250px",
      textAlign: "center",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
    },
    cardHover: {
      transform: "translateY(-8px)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.15)",
    },
    cardTitle: {
      fontSize: "20px",
      marginBottom: "10px",
      fontWeight: "bold",
    },
    cardText: {
      fontSize: "14px",
      marginBottom: "15px",
    },
    cardLink: {
      color: "#ffffff",
      textDecoration: "none",
      fontWeight: "bold",
      border: "2px solid #ffffff",
      padding: "8px 15px",
      borderRadius: "5px",
      display: "inline-block",
      transition: "background-color 0.3s ease, border-color 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#1976d2",
      borderColor: "#1976d2",
    },
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>ADMIN</h2>
        <ul style={styles.sidebarMenu}>
          <li>
            <Link
              to="/"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              Dashboard
            </Link>
          </li>
          <li>
            <Link
              to="/StudentDetails"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              StudentDetails
            </Link>
          </li>
          <li>
            <Link
              to="/StudentRegistration"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              StudentRegistration
            </Link>
          </li>
          <li>
            <Link
              to="/MarkView"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              MarkView
            </Link>
          </li>
          <li>
            <Link
              to="/station-registration"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              Station Master Registration
            </Link>
          </li>
          <li>
            <Link
              to="/station-list"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              Station Master List
            </Link>
          </li>
          <li>
            <Link
              to="/report"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              Report
            </Link>
          </li>
          <li>
            <Link
              to="/logout"
              style={styles.sidebarLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              Logout
            </Link>
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div style={styles.mainContent}>
        <header style={styles.header}>
          <h1 style={styles.headerTitle}>Welcome to AQUAMOTUS - Admin Dashboard</h1>
        </header>
        <div style={styles.cardsContainer}>
          {/* Card 1 */}
          <div
            style={styles.card}
            onMouseOver={(e) => (e.currentTarget.style.transform = styles.cardHover.transform)}
            onMouseOut={(e) => (e.currentTarget.style.transform = "")}
          >
            <h3 style={styles.cardTitle}>Boat</h3>
            <p style={styles.cardText}>Manage Boat Details</p>
            <Link
              to="/boat"
              style={styles.cardLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.cardLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              More info &#8594;
            </Link>
          </div>

          {/* Card 2 */}
          <div
            style={styles.card}
            onMouseOver={(e) => (e.currentTarget.style.transform = styles.cardHover.transform)}
            onMouseOut={(e) => (e.currentTarget.style.transform = "")}
          >
            <h3 style={styles.cardTitle}>Event</h3>
            <p style={styles.cardText}>Manage Events</p>
            <Link
              to="/event"
              style={styles.cardLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.cardLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              More info &#8594;
            </Link>
          </div>

          {/* Card 3 */}
          <div
            style={styles.card}
            onMouseOver={(e) => (e.currentTarget.style.transform = styles.cardHover.transform)}
            onMouseOut={(e) => (e.currentTarget.style.transform = "")}
          >
            <h3 style={styles.cardTitle}>Settings</h3>
            <p style={styles.cardText}>Manage Station Master Details</p>
            <Link
              to="/settings"
              style={styles.cardLink}
              onMouseOver={(e) => (e.target.style.backgroundColor = styles.cardLinkHover.backgroundColor)}
              onMouseOut={(e) => (e.target.style.backgroundColor = "")}
            >
              More info &#8594;
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
